import { Loader } from "@googlemaps/js-api-loader"

const Map = () => {


  const loader = new Loader({
    apiKey: "AIzaSyCGS2WtILf44yoYvgazgmoW4wR7qVb9vTM",
    version: "weekly",

  });

  loader.load().then((google) => {
    map = new google.maps.Map(document.getElementById("map"), {
      center: { lat: 38.651606, lng: -90.314901 },
      zoom: 8,
    });
  });

  return <div>{map}</div>;
}
export default Map;

